import React, { useEffect, useState } from 'react';
import axios from 'axios';

const App = () => {
  const [bestCPU, setBestCPU] = useState({});
  const [allCPUs, setAllCPUs] = useState([]);
  const [showAllCPUs, setShowAllCPUs] = useState(false);

  useEffect(() => {
    // Fetch the best CPU
    axios.get('http://localhost:3001/best-cpu')
      .then(response => {
        setBestCPU(response.data);
      })
      .catch(error => {
        console.error('Error fetching best CPU:', error);
      });

    // Fetch all CPUs
    axios.get('http://localhost:3001/cpus')
      .then(response => {
        setAllCPUs(response.data);
      })
      .catch(error => {
        console.error('Error fetching CPUs:', error);
      });
  }, []);

  const handleBestCPUCollapse = () => {
    setShowAllCPUs(!showAllCPUs);
  };

  return (
    <div>
      <h1>Best CPU</h1>
      <table>
        <thead>
          <tr>
            <th>CPU</th>
            <th>RP</th>
            <th>Price</th>
            <th>PPD</th>
          </tr>
        </thead>
        <tbody>
          <tr onClick={handleBestCPUCollapse} style={{ cursor: 'pointer' }}>
            <td>{bestCPU.CPU}</td>
            <td>{bestCPU.RP}</td>
            <td>{bestCPU.Price}</td>
            <td>{bestCPU.PPD}</td>
          </tr>
        </tbody>
      </table>

      {showAllCPUs && (
        <div>
          <h1>All CPUs</h1>
          <select>
            {allCPUs.map(cpu => (
              <option key={cpu.CPU}>{cpu.CPU}</option>
            ))}
          </select>
        </div>
      )}
    </div>
  );
};

export default App;
